import React from 'react';
import './App.css';

import LoginPage from '../LoginPage/LoginPage';


function App() {
  let retApp = () => {
    let pp = <LoginPage/>;
    return pp
  }
  return (
    <div className="App">
      {retApp()}
    </div>
  );
}

let mapStateToProps = ( store ) => {
  return {
    curPage : store.curPage
  }
}

export default App;
